static int
parser_yyinput_single_line (char *buff, int max_size)
{
  int c, end;
  int i = 0;

  do
    {
      c = pt_nextchar ();
      if (c == '\'' || c == '\"')	/* string start */
	{
	  buff[i++] = c;
	  if (i >= max_size)
	    {
	      return i;
	    }

	  end = c;
	  do
	    {
	      c = pt_nextchar ();
	      if (c == end)	/* string end */
		{
		  break;
		}

	      buff[i++] = c;
	      if (i >= max_size)
		{
		  return i;
		}

	      if (c == '\\')	/* if escape character */
		{
		  buff[i++] = c;
		  if (i >= max_size)
		    {
		      return i;
		    }

		  c = pt_nextchar ();	/* read one more */
		  buff[i++] = c;
		  if (i >= max_size)
		    {
		      return i;
		    }
		}

	    }
	  while (c != -1);
	}

      if (c == ';')
	{
	  buff[i++] = -1;
	  buff[i] = 0;
	  return i;
	}

      buff[i++] = c;
      if (i >= max_size)
	{
	  return i;
	}

    }
  while (c != -1);

  buff[i] = 0;
  parser_yyinput_single_mode = 0;	/* all done */
  return i;
}

static int
parser_yyinput_multi_line (char *buff, int max_size)
{
  int c;
  int i = 0;

  do
    {
      c = pt_nextchar ();
      buff[i++] = c;
      if (i >= max_size)
	{
	  return i;
	}

    }
  while (c != -1);

  buff[i] = 0;
  return i;
}

static int
parser_yyinput (char *buff, int max_size)
{
  if (!parser_yyinput_single_mode)
    {
      return parser_yyinput_multi_line (buff, max_size);
    }
  else
    {
      return parser_yyinput_single_line (buff, max_size);
    }
}

